import React, { useState, useEffect } from 'react'

interface Props {
  page:number
}
const Store: React.FC<Props> = ({page}) => {
  const [middlePage, setMiddlePage] = useState(page)

  const showPage = (number: number) => {
    setMiddlePage(number)
  }

  return (
    <div className='Store'>
      <h1>Store</h1>
      <button onClick={() => showPage(0)}>Story</button>
    </div>
  )
}

export default Store
